b = Game().board
cases = {(0, 0): [(0, 0)], (1, 2): [(0, 0), (1, 0), (1, 1)], (2, 0): [(2, 0
    )], (5, 2): [(4, 0), (4, 1)]}
for key in cases:
    point = b.points[key[0]][key[1]]
    answers = cases[key]
    for ans in answers:
        tile = b.tiles[ans[0]][ans[1]]
        assert tile in point.tiles
